package br.com.usinasantafe.pcomp.to.tb.variaveis;

public class TurnoVarTO {

    private Long matriculaMotoristaTurno;
    private Long codTurno;
    private Long verTurno;
    private Long tipoAtividade;

    public TurnoVarTO() {
		// TODO Auto-generated constructor stub
	}

	public Long getMatriculaMotoristaTurno() {
		return matriculaMotoristaTurno;
	}

	public void setMatriculaMotoristaTurno(Long matriculaMotoristaTurno) {
		this.matriculaMotoristaTurno = matriculaMotoristaTurno;
	}

	public Long getCodTurno() {
		return codTurno;
	}

	public void setCodTurno(Long codTurno) {
		this.codTurno = codTurno;
	}

	public Long getVerTurno() {
		return verTurno;
	}

	public void setVerTurno(Long verTurno) {
		this.verTurno = verTurno;
	}

	public Long getTipoAtividade() {
		return tipoAtividade;
	}

	public void setTipoAtividade(Long tipoAtividade) {
		this.tipoAtividade = tipoAtividade;
	}
    
}
